/*
STEP 2a: Create the field categories table
*/

CREATE TABLE `aggregator`.`field_categories` (
  `fieldCategory` INT UNSIGNED NOT NULL,
  `fieldCategoriesTitle` VARCHAR(45) NOT NULL,
  `fieldCategoriesDescription` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`fieldCategory`))
COMMENT = 'The descriptive content of the field ID/Data Register categories, to help create new fieldIDs and correctly categorise them.';


/*
STEP 2b: Populate the field categories table
*/




/*
STEP 2c: Create the transaction field table
*/

CREATE TABLE `aggregator`.`transaction_fields` (
  `fieldId` smallint(5) unsigned NOT NULL,
  `fieldMaster` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT 'The field Master relates to one entrance in this table that works as the ''pointer'' for all the other fieldIds, e.g. all emailAddress should have one master and all dpids thould have one master fieldId.',
  `fieldCategory` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'This relates directly to the data register.',
  `fieldCode` char(128) NOT NULL COMMENT 'The textual value of the ''xapth'' field name.',
  `verticalId` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'FK to the vertical master table.',
  `fieldPriority` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT 'Can be used to ''order'' any references to similar fields, e.g. prioritise the email addresses from save, application, and contact.',
  `fieldProfile` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'POC: could be used to show the users specific profile information, values.',
  `fieldPrivate` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'POC could be used to hash and prevent saving these fields.',
  `fieldHidden` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'POC could be used to prevent user profiles from seeing/updating these values.',
  `isMaster` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'POC used to easily identify the master fieldId.',
  `effectiveEnd` datetime NOT NULL DEFAULT '2040-12-31 00:00:00',
  PRIMARY KEY (`fieldId`),
  UNIQUE KEY `transaction_fields_idx_fieldCode` (`fieldCode`),
  KEY `transaction_fields_idx_fieldMaster` (`fieldMaster`),
  KEY `transaction_fields_idx_fieldCategory` (`fieldCategory`),
  KEY `transaction_fields_fk_verticalId_idx` (`verticalId`),
  CONSTRAINT `transaction_fields_fk_verticalId` FOREIGN KEY (`verticalId`) REFERENCES `ctm`.`vertical_master` (`verticalId`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='Transaction fields is using the old xpath to new fieldId. Categories will relate to the data_register to partition/separate the text values.';

/*
STEP 2d: Populate the transaction field table
*/
